import './App.css';
import {useState,useEffect} from 'react';
import axios from 'axios';

function App() {
  const [memories,setMemories]=useState([
    {
      name:"rahat_almas",
      post:{
        title:"love story",
        desc:"story comming soon..."
      }
    }
  ]);
  useEffect(()=>{
     axios.get("http://localhost:5000/allmemories/rahat_almas")
      .then((response)=>{
        console.log(response.data);
        setMemories(response.data);
      })
  },[])
  return (
    <div className="App">
      hello world
    </div>
  );
}

export default App;
